import About from './About';
import './App.css';
import Home from './Home';
import Nav from './Nav';
import ProjectCard from './ProjectCard';

function App() {
  <link href='https://cdn.jsdelivr.net/npm/boxicons@2.0.5/css/boxicons.min.css' rel='stylesheet'></link>
  return (
    <div className="App">
        <Nav/>
        <Home/>
        <About/>
    </div>
  );
}

export default App;
